import './App.css';

function App() {
  return (
    <Routes>

        <Route path="/" element={<Homepage/>}/>
        <Route path="/blog" element={<Blog/>}/>
        <Route path="/portafolio" element={<Portafolio/>}/>
        <Route path="/about" element={<About/>}/>

    </Routes>
  );
}

export default App;
